### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. SQL Queries and Operations
- **SQL Syntax and Clauses**: Understanding of `SELECT`, `FROM`, `WHERE`, `GROUP BY`, `ORDER BY`, `JOIN`, `NATURAL JOIN`, `EXISTS`, `LIKE`, `ALL`, and `DISTINCT`.
- **Aggregation Functions**: Use of `COUNT`, `SUM`, `AVG`, etc.
- **Pattern Matching**: Use of `LIKE` with wildcards `%` and `_`.
- **Subqueries**: Writing and understanding nested queries.
- **Set Operations**: Understanding of `UNION`, `INTERSECT`, and `EXCEPT`.

#### 2. Relational Algebra
- **Basic Operations**: Selection (`σ`), Projection (`Π`), Cartesian Product (`×`), Join (`⋈`), and Set Operations.
- **Tuple Relational Calculus (TRC) and Domain Relational Calculus (DRC)**: Understanding and translating SQL queries into TRC and DRC expressions.

#### 3. Database Design and Constraints
- **Primary Key and Foreign Key**: Understanding and applying constraints.
- **Integrity Constraints**: Understanding `CHECK`, `ON DELETE CASCADE`, and other constraints.
- **Candidate Keys and Super Keys**: Understanding minimal super keys and candidate keys.

#### 4. Entity-Relationship (E-R) Diagrams
- **Entities and Attributes**: Identifying and defining entities and their attributes.
- **Relationships**: Understanding and defining relationships between entities.
- **Relational Schema**: Translating E-R diagrams into relational schemas.

#### 5. Database Normalization
- **Normal Forms**: Understanding 1NF, 2NF, 3NF, BCNF, and 4NF.
- **Functional Dependencies**: Identifying and applying functional dependencies.

