### Key Equations and Syntax

1. **SQL SELECT Statement**:
   ```sql
   SELECT column1, column2, ...
   FROM table_name
   WHERE condition;
   ```

2. **SQL GROUP BY Statement**:
   ```sql
   SELECT column1, aggregate_function(column2)
   FROM table_name
   GROUP BY column1;
   ```

3. **SQL JOIN Statement**:
   ```sql
   SELECT column1, column2, ...
   FROM table1
   JOIN table2 ON table1.column = table2.column;
   ```

4. **SQL Subquery**:
   ```sql
   SELECT column1, column2, ...
   FROM table_name
   WHERE column1 IN (SELECT column1 FROM table_name WHERE condition);
   ```

5. **Relational Algebra Selection**:
   ```latex
   \sigma_{condition}(relation)
   ```

6. **Relational Algebra Projection**:
   ```latex
   \Pi_{attributes}(relation)
   ```

7. **Relational Algebra Join**:
   ```latex
   relation1 \bowtie relation2
   ```

8. **Tuple Relational Calculus**:
   ```latex
   \{ t | \phi(t) \}
   ```

9. **Domain Relational Calculus**:
   ```latex
   \{ <x1, x2, ..., xn> | \phi(x1, x2, ..., xn) \}
   ```

